En realidad no escucho ningún tipo de música en particular, pero a veces suelo poner algo de música épica como [ésta](https://www.youtube.com/watch?v=iHjc_O85tNU). Me encantan esos temas, son muy motivadores. Eso sí, si vas a usarla para jugar, tené en cuenta que esta música te invita amablemente a tryhardear todo el tiempo. Tenés que aprender a controlarlo. Es como el KaioKen de Goku, si lo usás demasiado tiene consecuencias nefastas.
